INSERT INTO `diaries` VALUES (5,'/mnt/diaries/4/2024-08-07/img-kXUeszDoO7IYrSBiD3Giet1t.png','오늘은 카페에서 맛있는 아이스크림을 먹었다! 오랜만에 만나서 진대를 많이 했는데, 서로 더 가까워질 수 있어서 행복했다! ','2024-08-07','유명한 카페에 간 날',4,8),(6,'/mnt/diaries/4/2024-08-07/img-9s0tpDSZ3nWLfqp85rvvqoi3.png','여자친구와 장태산에 가서 등산을 하고 정상에서 사진을 찍었다. 그리고 같이 근처 펜션에 가서 하룻밤 묵고 캠핑을 즐겼다.','2024-08-07','장태산 캠핑',4,8),(9,'/mnt/diaries/4/2024-08-07/img-hNcRDiGAbf5bMCPJDiyNoVcg.png','여자친구랑 은행동 보드게임 카페에서 보드게임을 했다. 오늘은 내가 많이 이겨서 기분이 좋았다. 분해하는 여자친구도 귀여웠다.','2024-08-07','보드게임 데이트',4,8),(12,'/mnt/diaries/37/2024-08-08/img-chO3Dlt3ne69lYwFf4VtW8QG.png','망고빙수❄️','2024-08-08','오늘의 일기',37,14),(14,'/mnt/diaries/37/2024-08-08/img-toU3GlfbNh0E93IyvVmownFe.png','after exam date and watching movie','2024-08-08','test day',37,15),(15,'/mnt/diaries/42/2024-08-09/img-8BqXZ8fpfNj1XoXtVc7d5qL4.png','강아지','2024-08-09','안녕!',42,5),(23,'/mnt/diaries/4/2024-08-11/img-Fpt6Z34foGwlQvelQq5xEyBX.png','오늘은 여자친구와 집에서 같이 공부를 했다. 하기 싫은 공부도 같이 하니까 즐거웠다!','2024-08-11','스터디',4,9),(26,'/mnt/diaries/77/2024-08-06/img-SMhNsIEoTaiG5nR47iRHw26f.png','집에서 악어랑 놀았어','2024-08-06','고양이다묭',77,30),(29,'/mnt/diaries/70/2024-08-12/img-9HvHKn9Jn4icEFjvcx3NR5W3.png','park good','2024-08-12','jungsuk',70,20),(36,'/mnt/diaries/4/2024-08-12/img-8kJvUgPVT2BoKcK6jO0hFkaG.png','오늘은 둘이 같이 공원에서 산책했다. 여름이지만 바람이 선선하게 불어서 좋았다.','2024-08-12','공원 산책 데이트',4,9),(37,'/mnt/diaries/4/2024-08-12/img-AmoI8tNh0AupK2ifs3qjlkly.png','여자친구와 같이 배드민턴을 쳤다. 날씨가 좀 덥긴 했지만 체육관 안에 에어컨이 빵빵해서 시원하게 칠 수 있었다 너무 즐거웠다','2024-08-12','같이 배드민턴 친 날',4,9),(48,'/mnt/diaries/77/2024-08-09/img-5bsjK8ZuGRnonolJfRZuN5td.png','강아지랑 고양이랑 놀았어요','2024-08-09','강아지랑',77,30),(49,'/mnt/diaries/77/2024-08-10/img-5bsjK8ZuGRnonolJfRZuN5td.png','강아지랑 고양이랑 놀았어요','2024-08-10','강아지랑',77,30),(50,'/mnt/diaries/77/2024-08-10/img-5HUCFgoD8yx0CcJuKoNChlVv.png','강아지랑 고양이랑 놀았어요','2024-08-10','강아지랑',77,30),(51,'/mnt/diaries/79/2024-08-10/img-5HUCFgoD8yx0CcJuKoNChlVv.png','강아지랑 고양이랑 놀았어요','2024-08-10','강아지랑',79,33),(52,'/mnt/diaries/4/2024-08-12/img-cCsgkPD0nmkKl4Cl5FHOK2g1.png','시내에서 여자친구와 불고기를 먹었다. 맛집이라더니 엄청 맛있었다.','2024-08-12','고기고기',4,9),(53,'/mnt/diaries/1/2024-08-13/img-D56KDprN6RBHbEAOPIAGEVr0.png','i had very exciting game with my boy friend in my home','2024-08-13','play game',1,7),(54,'/mnt/diaries/1/2024-08-13/img-0BPHaMtLuGv9Q2bxS1LrqrBW.png','with my boyfriend','2024-08-13','play game',1,7),(55,'/mnt/diaries/1/2024-08-13/img-cuBxh2DbjjCG1iyDUsdEOhCB.png','hard working','2024-08-13','hard working',1,7),(56,'/mnt/diaries/1/2024-08-13/img-RyQNwdXJfGAwlRqsEnCObnZj.png','오늘은 여자친구와 여자친구의 친구들을 만났다. 조금 정신없긴 했지만 그래도 즐거웠다!','2024-08-13','친구들 만난 날',1,7),(57,'/mnt/diaries/1/2024-08-13/img-m1fkSl9Tvmc4ahCgl3zwSx49.png','test11','2024-08-13','test',1,6),(58,'/mnt/diaries/4/2024-08-14/img-K2oOBPzc2SqInNHP2ayFfEhq.png','여자친구와 휴가 동안 부산 해운대를 갔다. 바닷가를 보며 맛있는 회를 먹었다. 정말 즐거웠다.','2024-08-14','부산 여행',4,8),(59,'/mnt/diaries/1/2024-08-14/img-7AlH629BeEWU3olDa0lV70bZ.png','i\'m wating','2024-08-14','hi',1,6),(60,'/mnt/diaries/70/2024-08-14/img-xOeGAfhpsiEF1Yc6eg265FEo.png','오늘 지훈이랑 야구직관을 갔다 너무더웠지만 재밌었다','2024-08-14','야구',70,2),(61,'/mnt/diaries/70/2024-08-14/img-A0OQuwEsy5xT7FDG2ItGdo4Y.png','오늘 지훈이랑 야구직관을 갔다 너무더웠지만 재밌었다','2024-08-14','야구',70,2),(62,'/mnt/diaries/4/2024-08-14/img-2lAMoNCpdVbF9JUcxduTfHYM.png','여자친구와 축구 경기를 보러 갔다. 우리나라 대표팀이 이겨서 기분이 좋았다.','2024-08-14','축구 경기',4,8),(63,'/mnt/diaries/4/2024-08-14/img-v4QmikSsby6101QQKg70DBpU.png','지훈이랑 공원 데이트했는데 너무 재밌었다','2024-08-14','지훈이랑 공원 데이트',4,9),(64,'/mnt/diaries/70/2024-08-14/img-KTeCeEMKGoHXsnGHnR8KX8bl.png','맛있었잖아 너도지?','2024-08-14','오늘 찜닭 같이 먹었다',70,20),(65,'/mnt/diaries/70/2024-08-14/img-pdYhZBK53O44ncneuRat8krL.png','맛있었잖아 너도지? 찜닭인디','2024-08-14','오늘 찜닭 같이 먹었다',70,20),(66,'/mnt/diaries/70/2024-08-14/img-9y9KoJlPson60ICx6FJJ7pl6.png','경복궁','2024-08-14','하이',70,20),(68,'/mnt/diaries/4/2024-08-14/img-upMX6MSOBh6WR4zAQiU4xg7X.png','여자친구랑 같이 밴드 음악을 들었다.','2024-08-14','음악 감상',4,8),(69,'/mnt/diaries/77/2024-08-14/img-F0zecsM9EfdtDIa0mAcTPzXU.png','with my gf','2024-08-14','kiki',77,30),(70,'/mnt/diaries/1/2024-08-15/img-ppVhMHuMsnUkZaZNtWD6mKW2.png','지훈이랑 사슴공원에 놀러갔다','2024-08-15','사슴공원',1,6),(71,'/mnt/diaries/84/2024-08-17/img-PqkN49aO0wlE09k2uA7CUM3J.png','오늘은 성심당에 가서 맛있는 빵을 많이 먹었다. 역시 대전하면 성심당이다. 정말 맛있었고 즐거웠다.','2024-08-14','성심당 방문!',84,45),(72,'/mnt/diaries/84/2024-08-17/img-IBwrMO5ThvBkdUMrjPFInStV.png','저녁에 한밭수목원에서 산책을 했다. 주변 나무들과 조명들이 예뻤고 바람이 선선하게 불어서 더 좋았다.','2024-08-12','한밭수목원 데이트',84,45),(73,'/mnt/diaries/84/2024-08-18/img-owVRx8DSeZHTQ5gVv7AnZiEI.png','오늘은 여자친구와 보드게임 카페에 갔다. 내가 게임을 많이 이겨서 여자친구가 심술이 났는데, 너무 귀여웠다. 다음엔 좀 져줘야겠다 ㅎㅎ','2024-08-11','보드게임 한 날',84,45),(74,'/mnt/diaries/84/2024-08-10/img-pnK94xBGD5AGcyFKym29q0S1.png','오늘은 여자친구와 등산을 했다. 정상에서 사진도 찍고 산을 내려와서는 한식당을 가서 맛있게 비빔밥을 먹었다. 너무 즐거웠다!','2024-08-10','장태산 등산',84,45),(75,'/mnt/diaries/84/2024-08-11/img-jITC70ZKgRK2VaGdSyKLJ4yI.png','오늘은 카페에서 여자친구랑 같이 스터디를 했다. 함께 공부하니까 지루하지도 않고 재밌게 공부를 할 수 있었다.','2024-08-11','같이 스터디',84,45),(76,'/mnt/diaries/84/2024-08-13/img-xbExaMrKxCnssLMUz4YUh6hY.png','오늘은 여자친구와 축구 국가대표 경기를 직관했다. 일본과의 경기였는데, 치열한 경기 끝에 대한민국 대표팀이 승리를 거두었다. 정말 짜릿하고 즐거운 시간이었다!','2024-08-13','축구 경기 직관',84,45),(77,'/mnt/diaries/84/2024-08-15/img-IfDgm3rZbtElYwMqNkTvHdao.png','남자친구와 아쿠아리움에 데이트를 갔다. 엄청 큰 상어도 있었고 색깔이 화려한 열대어도 있었다. 남자친구와 데이트 너무 재미있었다!!','2024-08-15','아쿠아리움 데이트',84,46),(78,'/mnt/diaries/85/2024-08-15/img-Fkzggs7i0f5koOwkwuzjz5EE.png','오늘은 윈터와 한강데이트를 했다. 화창한 날씨에 피크닉을 하며 따스한 햇살을 즐기다가 석양이 질 때 , 사진을 찍고 집으로 돌아왔다. 정말 재밌었다','2024-08-15','한강데이트',85,47);
