INSERT INTO `annoucements` VALUES (8,'우리의 첫 번째 기념일을 축하하기 위한 특별 이벤트가 시작되었습니다!','2024-08-10','새로운 이벤트 안내','관리자'),(9,'안정성을 개선하고 새로운 기능을 추가하기 위해 앱이 업데이트되었습니다. 이제 더욱 다양한 커플 활동을 기록할 수 있습니다.','2024-08-10','업데이트 공지','관리자'),(10,'일부 사용자가 겪었던 사진 업로드 문제를 해결했습니다. 이제 모든 추억을 안전하게 저장하세요.','2024-08-10','버그 수정 안내','관리자'),(11,'프로필 화면에서 커플 테마를 자유롭게 변경할 수 있는 기능이 추가되었습니다. 나만의 특별한 테마를 만들어보세요.','2024-08-10','프로필 커스터마이징','관리자');
